import { useState } from 'react';
import '../styles/App.scss';

function App() {
	return (
		<div>
			<h1>Selecciona los ingredientes de la tortilla de patata</h1>

			<form className="formContainer" action="">
				<label htmlFor="macarrones">
					<input type="checkbox" name="false" id="macarrones" />
					Macarrones
				</label>
				<label htmlFor="patatas">
					<input type="checkbox" name="true" id="patatas" />
					Patatas
				</label>
				<label htmlFor="nueces">
					<input type="checkbox" name="false" id="nueces" />
					Nueces
				</label>
			</form>
		</div>
	);
}

export default App;
